import Hero from "./components/hero"
import Projects from "./components/project/list"

const App = ()=>{
    return (
        <>
            <Hero/><br />
            <section  className="hero" style={{background: "gray"}}>
                <h1>Projects</h1>
                <Projects></Projects>
            </section>
            
        </>
    )
}
export default App;
